const clog=console.log;function dlog(exprVal,...y){const output=[exprVal,...y.slice(1)];return y.length&&"function"==typeof y[0]?y[0](...output)&&clog(...output):(y[0]&&output.unshift(y[0]),clog(...output)),exprVal}function testCheck(f,...p){try{return f(...p)}catch(err){return clog(err.message),!1}}module.exports={clog:clog,dlog:dlog,testCheck:testCheck};